def characterReplacement(s: str, k: int):  # AAABABABBBBBABABABA, 2
    # def firstDiff(s):
    #     base = s[0]
    #     for i in range(1, len(s)):
    #         if s[i] != base:
    #             return i

    def replaceAndrepeat(s):  # return how many needs to be replaced
        dict = {}
        for i in s:
            if i not in dict:
                dict[i] = 0
            dict[i] += 1

        s = 0
        m = -float('inf')
        for v in dict.values():
            s += v
            m = max(m, v)
        return s - m

    l, r = 0, 0
    # curr = ""
    output = -float('inf')
    dict = {}
    while r < len(s):
        curr = s[l:r + 1]
        if curr[-1] not in dict:
            dict[curr[-1]] = 0
        dict[curr[-1]] += 1
        t = sum(dict.values()) - max(dict.values())  # this is replacing the replaceAndrepeat function
        # t = replaceAndrepeat(curr)
        if t == k:
            output = max(output, len(curr))
        elif t > k:
            dict[s[l]] -= 1
            l += 1

        r += 1

    return len(s) if output == -float('inf') else output  # it does not need to k changes (0, or less than K to make it full repeat)


#
print(characterReplacement(s="ABAB", k=2))  # 4
print(characterReplacement(s="AAAA", k=2))  # 4
print(characterReplacement(s="AABABBA", k=1))  # 4
print(characterReplacement(s="AAABABABBBBBABABABA", k=2))  # 9
print(characterReplacement(s="AAABABABBBBBABABABAABBBBAAAABBBBBBBBAABBBBBBBBBBBBBBBBBBBBBBB", k=9))  # 46
print(characterReplacement(
    ""
    , 7520))  # 7864
